  "title": {
    "nb": "Dybdedata - terrengmodeller 5 meters grid"
  },
  "description": {
    "nb": "Datasettet viser terrengvariasjoner på havbunnen. Terrengmodellene har blitt produsert av innsamlede sjømålingsdata av høy kvalitet. Dekningsområdet er avhengig av kartleggingen i forbindelse med MAREANO programmet. MAREANO har kartlagt havområdene utenfor Møre og Romsdal, Trøndelag, Nordland, Troms, Finnmark, Barentshavet øst og ellers utvalgte områder ved Svalbard. Dekningsområdet utvides kontinuerlig etterhvert som nye områder blir kartlagt. Oppløsningen på terrengmodellene er 5m x 5m."
  },
  "descriptionFormatted": {
    "nb": "Datasettet viser terrengvariasjoner på havbunnen. Terrengmodellene har blitt produsert av innsamlede sjømålingsdata av høy kvalitet. Dekningsområdet er avhengig av kartleggingen i forbindelse med MAREANO programmet. MAREANO har kartlagt havområdene utenfor Møre og Romsdal, Trøndelag, Nordland, Troms, Finnmark, Barentshavet øst og ellers utvalgte områder ved Svalbard. Dekningsområdet utvides kontinuerlig etterhvert som nye områder blir kartlagt. Oppløsningen på terrengmodellene er 5m x 5m."
  },
