  },
  "description": {
    "nb": "Datasettet viser kartlegging av arealbruksinteressene i de 15 utredningsområdene som er identifisert i rapporten ”Havvind – Forslag til utredningsområder”. Det er gjennomført konsekvensvurderinger for nærings-, samfunns- og miljøinteresser i og rundt utredningsområdene, og områdenes teknisk-økonomiske egnethet er vurdert. \n\nKonsekvensutredningene er gjort på et overordnet nivå, og det har vært NVEs mål å fremskaffe beslutningsrelevant kunnskap om utredningsområdene. Dette skal gi et tilstrekkelig kunnskapsgrunnlag for å gi anbefalinger om åpning av områder for konsesjonssøknader om utbygging av havvindkraft."
  },
