  "title": {
    "nb": "Det sentrale folkeregisteret"
  },
  "description": {
    "nb": "Folkeregisteret omfatter nøkkelopplysninger om alle personer som er eller har vært bosatt i Norge. Registeret danner grunnlaget for blant annet skattemanntallet, valgmanntallet og befolkningsstatistikken. Et korrekt folkeregister er en forutsetning for at alle borgere skal motta informasjon fra offentlige myndigheter, og at deres rettigheter og plikter blir ivaretatt."
  },
  "descriptionFormatted": {
    "nb": "Folkeregisteret omfatter nøkkelopplysninger om alle personer som er eller har vært bosatt i Norge. Registeret danner grunnlaget for blant annet skattemanntallet, valgmanntallet og befolkningsstatistikken. Et korrekt folkeregister er en forutsetning for at alle borgere skal motta informasjon fra offentlige myndigheter, og at deres rettigheter og plikter blir ivaretatt."
  },
  "objective": {
    "nb": "Formålet er å legge til rette for sikker, korrekt og effektiv registrering av grunnleggende personopplysninger om den enkelte, herunder hvilke personer som er bosatt i Norge."
  },
