  "title": {
    "nb": "Kulturlandskap - verdifulle"
  },
  "description": {
    "nb": "Datasettet viser forvaltningsmessig høyt prioriterte kulturlandskapsområder med både biologiske og kulturhistoriske verdier. Datasettet omfatter blant annet de høgest prioriterte områdene i Nasjonal registrering av verdifulle kulturlandskap, og utgjør 10-30 områder i hvert fylke, totalt ca. 300 områder i landet. Datasettet er ajourført pr. september 2011, og vil bli fortløpende komplettert i Naturbase. Datasettet innholder utvalgte opplysninger fra et separat fagsystem for kulturlandskap som forvaltes av Fylkesmannen. Nærmere opplysninger kan fås derfra."
  },
