  "description": {
    "nb": "NAVs stillingssøk på Arbeidsplassen inneholder en oversikt over de fleste aktive ledige stillinger. Stillingssøket inneholder både stillinger som er registrert direkte hos NAV samt hentet inn fra en rekke nettsteder Stillingsdata meldes og registreres i NAV basert på ( Lov om arbeidsmarkedstjenester § 7,2004 ) Ikke alle stillinger som blir meldt til NAV blir publisert på Arbeidsplassen Du finner dokumentasjon av applikasjonsgrensesnittet på https://github.com/navikt/pam-public-feed med dokumentasjon i Swagger som gir deg mulighet til å eksperimentere med grensesnittet og en offentlig tilgangsnøkkel for utvikling og eksperimentering. Vi anbefaller alle som bygger tjenester med applikasjonsgrensesnittet om å registrere seg for å få en egen tilgangsnøkkel. Den vil holde seg stabil over tid. Du finner mer informasjon om registering her: https://data.nav.no/pages/vilkaar-api-stillingsannonser"
