  "title": {
    "nb": "Enhetsregisteret"
  },
  "description": {
    "nb": "Enhetsregisteret har som hovedoppgave å samordne opplysninger om næringslivet og offentlige etater som finnes i ulike offentlige registre. Enhetsregisteret inneholder grunndata om enheter som har registreringsplikt i NAV Aa-registeret, Merverdiavgiftsregisteret, Foretaksregisteret, Statistisk sentralbyrås bedriftsregister, Skattedirektoratets register over upersonlige skatteytere eller Stiftelsesregisteret. Alle registrerte enheter identifiseres med en entydig identifikator, et ni-sifret organisasjonsnummer. Fra data.brreg.no og hotell.difi.no kan du benytte API for både søk i og nedlasting av komplett datasett. Ved direkteoppslag får du tilgang til informasjon fra data.brreg.no i sanntid. Fra hotell.difi.no er det i hovedsak en forsinkelse i oppdateringshyppighet på ca 8-24 t. Komplett datasett for begge tjenenstene er basert forhåndsprodusert uttrekk hver natt (med unntak av natt til lørdag og mandag, hvor det ikke produseres filbasert datauttrekk). Datasettet omfatter utvalgte informasjonselementer for samtlige registrerte enheter i Enhetsregisteret, med unntak av organisasjonsformene TVAM (tvangsregistrert for mva), BEDR (underenheter/avdeling), AAFY (underenhet til ikke-næringsdrivende enhet) og UTLA (utenlandsk enhet). Enheter som er slettet i Enhetsregisteret er utelatt i datafilen. I overkant av 1 000 000 enheter inngår i datasettet, hvorav enkeltpersonforetak og aksjeselskap utgjør ca 80 % av bestanden (tall per 01.11.15). BEDR og AAFY finner du i datasettet Underenheter . Informasjon om næringskoder er basert på Norsk standard for næringsgruppering (SN2007) . Enheter som for eksempel er under konkursbehandling, tvangsoppløsning eller tvangsavvikling inngår i datasettet. Det er først ved sletting av enheter at disse utelates. Viktig statusinformasjon kan sjekkes ved søk i Brønnøysundregistrenes elektroniske kunngjøringstjeneste. Dersom det er behov for ytterligere data, som ikke er tilgjengelig via datahotellet, finnes følgende alternativ: Nøkkelopplysninger fra Enhetsregisteret Produkter og tjenester i Altinn Brønnøysundregistrenes nettbaserte bestillingsløsning Bestillinger av «skreddersydd» foretaksinformasjon/statistikker"
  },
