  },
  "description": {
    "nb": "Stavanger Kommune fører KOSTRA-regnskap. Les om KOSTRA på https://www.regjeringen.no/no/tema/kommuner-og-regioner/kommuneokonomi/kostra/ Regnskapet består av 6 datasett. Datasett med samme årstall hører sammen: -Driftsregnskaps- og Budsjettall - Investeringsregnskaps- og Budsjettall - Artskontoplan, med kobling mot KOSTRA-Art - Ansvarskontoplan - Prosjektkontoplan - Fri dimensjon -kontoplan Drifts- og Investeringsregnskap og Budsjett er fordelt på 5 dimensjoner: - Art - Ansvar - KOSTRA-funksjon - Prosjekt - Fri dimensjon Regnskap og budsjett er fordelt på perioder. Tallene er ikke akkumulerte. Det er ikke sum-linjer per dimensjon. (Eks. ønsker du å vite hvor mye som er brukt på mat de 4 første måneder, summerer du sammen alle linjer med Art 11150, og periode 1,2,3,4, uavhengig hva som er fylt ut i de resterende konteringsdimensjoner.)"
  },
